import ProductCard from "../ProductCard";

const ProductList = ({ list, variant }) => {
  console.log(list);
  return (
    <div>
      <div>{variant ? "Carrinho" : "Produtos"}</div>
      <ul>
        {list.map(({ item }) => (
          <ProductCard item={item} variant={variant} />
        ))}
      </ul>
    </div>
  );
};

export default ProductList;
